sys_variable_value.value:
(function execute(inputs, outputs) {
  // ... code ...
  var orderLineID = inputs.orderLineID;
  var accountSysID = inputs.accountSysID;
  var parentOrderID = inputs.productOrderID;

  var task = new GlideRecord('sn_ind_tmt_orm_order_task');
  task.initialize();
  task.order_line_item = orderLineID;
  task.account = accountSysID;
  task.parent = inputs.productOrderId;
  task.short_description = "StartBilling";
  task.state = 2;
  task.insert();

})(inputs, outputs);

